challange = ["","","","",""]

known1985 = ["ULL","RRDDD","LURDL","UUUUD"]

solve = list
  where (_, list) = foldl decode (5, []) challange

decode :: (Int, [Int]) -> [Char] -> (Int, [Int])
decode (start, prev) path = (pos, prev ++ [pos])
  where pos = foldl move start path

move :: Int -> Char -> Int
-- up
move 4 'U' = 1
move 5 'U' = 2
move 6 'U' = 3
move 7 'U' = 4
move 8 'U' = 5
move 9 'U' = 6

-- right
move 1 'R' = 2
move 4 'R' = 5
move 7 'R' = 8
move 2 'R' = 3
move 5 'R' = 6
move 8 'R' = 9

-- down
move 1 'D' = 4
move 2 'D' = 5
move 3 'D' = 6
move 4 'D' = 7
move 5 'D' = 8
move 6 'D' = 9

-- left
move 2 'L' = 1
move 5 'L' = 4
move 8 'L' = 7
move 3 'L' = 2
move 6 'L' = 5
move 9 'L' = 8

-- ignore the rest
move pos _ = pos